import React from "react";

const Card = () => {
  return (
    <div style={styles.card}>
      <img
        src="https://example.com/your-image.jpg" // Replace with your image URL
        alt="Card"
        style={styles.image}
      />
      <div style={styles.content}>
        <h2 style={styles.heading}>Card Heading</h2>
        <p style={styles.description}>
          This is a sample description for the card. You can provide more information about the content of the card here.
        </p>
      </div>
    </div>
  );
};

const styles = {
  card: {
    border: "1px solid #ddd",
    borderRadius: "8px",
    overflow: "hidden",
    maxWidth: "300px",
    margin: "20px",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
  },
  image: {
    width: "100%",
    height: "auto",
    borderRadius: "8px 8px 0 0",
  },
  content: {
    padding: "16px",
  },
  heading: {
    fontSize: "1.5rem",
    marginBottom: "8px",
  },
  description: {
    fontSize: "1rem",
    color: "#555",
  },
};

export default Card;
